  <meta name='twitter:description' content='Connect to Compete is a national private and nonprofit sector partnership created to increase broadband adoption and digital literacy training in disadvantaged communities throughout the United States. The initiative is designed to help residents improve outcomes in education, health, and employment through broadband opportunities and technology solutions. This map was created by selecting participating Internet Service Providers from the National Broadband Map. Providers participating in the Connect to Compete Home Broadband Coverage program are the following: Comcast, Time Warner Cable, Charter, Cablevision, Bright House Networks, Suddenlink, Insight, Midcontinent, GCI, Bend Cable, Mediacom, Eagle Communications, and Sjoberg. At smaller scales, all Connect to Compete coverage areas are depicted in bright green; users can zoom in to view individual provider coverage areas. Unpopulated areas are shown in grey. To learn more about Connect to Compete, visit www.fcc.gov or www.Connect2Compete.org (source data as of 12/2010).' />
